import React from 'react'
import '../../sass/Modules/M1/BrainStorming.scss'

export const BrainStorming = () => {
    return (
        <div className="brainStorming">
            <h1>What is <u>Brain Storming </u> ?</h1>
            <span><h1>Definition:</h1> Brainstorming is a technique for generating ideas in a group setting, where participants are encouraged to share their ideas in a free-flowing and non-judgmental environment. The goal of brainstorming is to generate as many ideas as possible without worrying about whetherthey are good or bad. The emphasis is on quantity, not quality.</span>

            <h1>Brain Storming vs MindMapping</h1>
            <span>Brainstorming is a technique for generating ideas, while mind mapping is a tool for organizing and connecting ideas. Brainstorming is typically done in a group setting, while mind mapping is usually done individually. Both techniques can be useful for generating and organizing ideas, and they can be used together as part of a larger creative process.</span>
        </div>
    )
}
